By Vieta's formulas, we know that \begin{align*}

a+b&=5\\

ab&=9.

\end{align*} Thus,

\begin{align*}

(a-1)(b-1)&=(ab-(a+b)+1)\\

&=9-5+1=\boxed{5}.

\end{align*}



We can also write $(a - 1)(b - 1)$ as $ab - (a + b) + 1$.

We simplify by multiplying out the terms and using $i^2=-1$: \begin{align*}

(2-2i)(5+5i)&amp;=10+10i-10i-10i^2\\

&amp;= 10 + 10 \\

&amp;=\boxed{20}.

\end{align*}

Substituting $f^{-1}(x)$ into our expression for $f$ we get  \[f(f^{-1}(x)) = f(x).\]Since $f(f(x))=x$ for all $x$, we have that $f(f^{-1}(x)) = x$. Therefore, we can substitute $f^{-1}(x)$ for $x$, and the expression becomes \[f(f^{-1}(x))=x.\]or \[f(x) = x.\]Subtracting the inverse of $f$ from both sides gives  \begin{align*}

f(x)-f^{-1}(x)& = f(x)-x \\

& = x - f^{-1}(x).

\end{align*}

We have that $f(2)=6$, so $f^{-1}(6)=2$. Therefore, $$f^{-1}\left(f^{-1}(6)\right) = f^{-1}(2).$$Since we also know that $f(3) = 5$, this implies that $f^{-1}(2) = 3$. Thus, \begin{align*}

f^{-1}\left(f^{-1}(6)\right)&=f^{-1}(2)=\boxed{3}.

\end{align*}

We have



\begin{align*}

\frac{2s^5}{s^3}-6s^2+\frac{7s^3}{s}&=\frac{2s^2}{1}-6s^2+7s\\

&=2s^2-6s^2+7s\\

&=-4s^2+7s.

\end{align*}
